import React from 'react'
import {Input} from '../../components'

const CreateBlog = () => {
    return ( 
        <div>
            <p>Create New Blog Post</p>
            <Input label="Post Title" />
            <p>Upload Image</p>
            <textarea></textarea>
        </div>
    )
}

export default CreateBlog
